import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Login from "./pages/Login";
import Signup from "./pages/Signup";
import Home from "./pages/Home";
import About from "./pages/About";
import Terms from "./pages/Terms";
import Contact from "./pages/Contact";
import "./App.css";
function LandingPage() {
  return (
    <div className="hero">
      <img src="/logo.png" alt="7 Star Interior Logo" className="logo" />
      <div>
        <label htmlFor="langSelect">Language:</label>
        <select id="langSelect">
          <option value="en">English</option>
          <option value="fr">Français</option>
          <option value="es">Español</option>
          <option value="hi">हिन्दी</option>
          <option value="te">తెలుగు</option>
        </select>
      </div>
      <div className="title">Welcome to 7 Star Interior App</div>
      <div className="tagline">Design with Voice. Visualize with AI. Approve with Ease.</div>
      <button onClick={() => window.location.href = "/login"}>Login</button>
      <a href="https://chat.openai.com/" target="_blank" className="chatgpt-fab" title="ChatGPT 4o-mini">
        <svg width="64" height="64" viewBox="0 0 64 64">
          <circle cx="32" cy="32" r="32" fill="#10A37F"/>
          <text x="32" y="38" textAnchor="middle" fontSize="18" fill="white" fontFamily="Arial" fontWeight="bold">4o</text>
        </svg>
      </a>
    </div>
  );
}
function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<LandingPage />} />
        <Route path="/login" element={<Login />} />
        <Route path="/signup" element={<Signup />} />
        <Route path="/home" element={<Home />} />
        <Route path="/about" element={<About />} />
        <Route path="/terms" element={<Terms />} />
        <Route path="/contact" element={<Contact />} />
      </Routes>
    </Router>
  );
}
export default App;
